import './style/App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

export default class App extends React.Component {

  constructor(props) {
    super(props);
  }

  componentDidMount() {
    document.title = "Hopewell Wordle Leaderboard"
  }

  render() {
    return (
        <BrowserRouter>
          <div>
            <h1> Hello world! </h1>
          </div>
        </BrowserRouter>
    )
  }
}
